(5, 'Книга это знание', 'Знание это свет', ' Book This knowledge', ' Knowledge This light', 'Зачем книга. Знание это свет. Книга это знание. Что такое книга? Книга — один из видов печатной продукции: непериодическое издание, состоящее из сброшюрованных или отдельных бумажных листов (страниц) или тетрадей.', '2024-07-30 07:07:36', ''),
(6, 'Книга это знание', 'Знание это свет', ' Book This knowledge', ' Knowledge This light', 'Зачем книга. Знание это свет. Книга это знание. Что такое книга? Книга — один из видов печатной продукции: непериодическое издание, состоящее из сброшюрованных или отдельных бумажных листов (страниц) или тетрадей.', '2024-07-30 07:09:17', ''),
(7, 'Книга это знание', 'Знание это свет', ' Book This knowledge', ' Knowledge This light', 'Зачем книга. Знание это свет. Книга это знание. Что такое книга? Книга — один из видов печатной продукции: непериодическое издание, состоящее из сброшюрованных или отдельных бумажных листов (страниц) или тетрадей.', '2024-07-30 07:11:45', ''),
(8, 'Книга это знание', 'Знание это свет', ' Book This knowledge', ' Knowledge This light', 'Зачем книга. Знание это свет. Книга это знание. Что такое книга? Книга — один из видов печатной продукции: непериодическое издание, состоящее из сброшюрованных или отдельных бумажных листов (страниц) или тетрадей.', '2024-07-30 07:13:12', ''),
(9, 'Все книги', '«Успех или успеть»', ' All books', ' \"Success or be on time\"', 'Данная книга раскрывает Вам, уважаемый читатель, пошаговые действия достижения успеха. Поможет понять и осознать, что именно для Вас является успехом. Поможет обрести здоровье, любовь, финансовую независимость и прочее факторы успешных людей. Советую Вам прочесть ее несколько раз,или сделать так , чтобы она всегда была у вас под рукой, как шпаргалка, которая дает ответы на самый главный вопрос.', '2024-07-30 07:16:35', ''),
(10, 'Все книги', '«Успех или успеть»', ' All books', ' \"Success or be on time\"', 'Данная книга раскрывает Вам, уважаемый читатель, пошаговые действия достижения успеха. Поможет понять и осознать, что именно для Вас является успехом. Поможет обрести здоровье, любовь, финансовую независимость и прочее факторы успешных людей. Советую Вам прочесть ее несколько раз,или сделать так , чтобы она всегда была у вас под рукой, как шпаргалка, которая дает ответы на самый главный вопрос.', '2024-07-30 07:20:20', ''),
(11, 'Джон Кехо', 'Подсознание может всё!', ' John Kehoe', ' Subconscious Maybe All!', 'Книга, которая изменит вашу жизнь! Самое известное исследование о подсознании от известного писателя и тренера личностного роста Джона Кехо! В подсознании каждого человека скрываются огромные резервы. И когда логика оказывается бессильной, именно подсознание поможет вам решать самые сложные повседневные проблемы. Джон Кехо три года провёл в лесах, вдали от людей, чтобы провести исследования работы человеческого мозга. Результатом стала эта программа, которая поможет вам активизировать безграничные ресурсы собственного головного мозга, чтобы изменить свою жизнь к лучшему раз и навсегда. Прослушав аудиокнигу, вы узнаете: – как формулировать и визуализировать свои цели; – как подсознание и интуиция могут помочь в достижении счастья; – как укрепить самооценку и развить творческие навыки; – как быть ощущать себя счастливым, независимо от обстоятельств.', '2024-07-30 07:22:20', ''),
(12, 'Джон Кехо', 'Подсознание может всё!', ' John Kehoe', ' Subconscious Maybe All!', 'Книга, которая изменит вашу жизнь! Самое известное исследование о подсознании от известного писателя и тренера личностного роста Джона Кехо! В подсознании каждого человека скрываются огромные резервы. И когда логика оказывается бессильной, именно подсознание поможет вам решать самые сложные повседневные проблемы. Джон Кехо три года провёл в лесах, вдали от людей, чтобы провести исследования работы человеческого мозга. Результатом стала эта программа, которая поможет вам активизировать безграничные ресурсы собственного головного мозга, чтобы изменить свою жизнь к лучшему раз и навсегда. Прослушав аудиокнигу, вы узнаете: – как формулировать и визуализировать свои цели; – как подсознание и интуиция могут помочь в достижении счастья; – как укрепить самооценку и развить творческие навыки; – как быть ощущать себя счастливым, независимо от обстоятельств.', '2024-07-30 07:24:30', ''),
(13, 'Богатый папа, бедный папа', 'Чему учат детей', ' Rich dad, poor dad', ' Why learn children', 'Автор убежден, что в школе дети не получают нужных знаний о деньгах и потом всю жизнь работают ради денег, вместо того чтобы заставить деньги работать на себя.\r\n\r\nДля широкого круга читателей.\r\n\r\nчитайте онлайн полную версию книги «Богатый папа, бедный папа» автора Роберт Кийосаки на сайте электронной библиотеки MyBook.ru. Скачивайте приложения для iOS или Android и читайте «Богатый папа, бедный папа» где угодно даже без интернета. ', '2024-07-30 07:49:40', ''),
(14, 'Граф Монте-Кристо', 'Зарубежные приключения', ' Graph Monte Cristo', ' Foreign adventures', '«Граф Монте-Кристо» — классика европейского романа 19 века. Александр Дюма взял за основу сюжета реальную историю из архивов французской полиции и сумел вплести в нее невероятные взлеты и падения, эпизоды подлого предательства и чистой любви, а также моменты отчаяния и искреннего раскаяния. Дюма изобличает алчность и желание власти, зависть и корысть, боязнь потерять лицо и отсутствие справедливости. Нет, он не делает главного героя ангелом, и тем понятнее и ближе становится Эдмонд Дантес читателю. Его судьба напоминает американские горки: в молодости Эдмонда оклеветали и заточили на долгие годы в мрачном и безнадежном месте – замке Иф. Его оторвали от любимой Мерседес и погубили всю его жизнь, все светлые чувства, вырастив в душе пленника лишь страсть возмездия. Но судьбе было угодно оставить Эдмонда в живых, познакомить его с одним умудренным жизнью стариком и сделать обладателем несметных сокровищ. «Граф Монте-Кристо» захлестывает читателя с головой, оставляя множество противоречивых эмоций и поводов к размышлению.\r\n\r\nчитайте онлайн полную версию книги «Граф Монте-Кристо» автора Александр Дюма на сайте электронной библиотеки MyBook.ru. Скачивайте приложения для iOS или Android и читайте «Граф Монте-Кристо» где угодно даже без интернета. ', '2024-07-30 21:37:55', ''),
